    true,nt"url": null,nt"notes": "<p>This dataset contains annual data on
    collections received and distributed by State agencies administering the Child Support
    Enforcement program under title IV-D of the Social Security Act. The information
    is obtained quarterly from a mandatory form submitted to the Agency by all participating
    states.<br />nThe Office of Child Support Enforcement uses this information to calculate
    and issue quarterly Federal grant awards and annual incentive payments to the State
    agencies administering the Child Support Enforcement Program.<br />nThis is considered
    public information and is published in an annual report of statistical and financial
    data available to the public.</p>n",nt"license_title": "Other License Specified",nt"extras":
